const AddEditBook = () => {
  return (
    <>
      <h2>Add / Edit Book</h2>

      <div style={{ width: "60%" }}>
        <input 
          type="text" 
          placeholder="Book Title" 
          style={{ width: "100%", marginBottom: "10px", padding: "8px" }}
        />

        <input 
          type="text" 
          placeholder="Author" 
          style={{ width: "100%", marginBottom: "10px", padding: "8px" }}
        />

        <input 
          type="number" 
          placeholder="Quantity" 
          style={{ width: "100%", marginBottom: "10px", padding: "8px" }}
        />

        <button style={{ padding: "10px 25px" }}>Save</button>
      </div>
    </>
  );
};

export default AddEditBook;
